package dev.chu.toyapp

import com.google.gson.GsonBuilder
import com.google.gson.reflect.TypeToken
import dev.chu.toyapp.common.Const
import dev.chu.toyapp.data.remote.ApiService
import dev.chu.toyapp.entity.GithubRepos
import okhttp3.OkHttpClient
import okhttp3.logging.HttpLoggingInterceptor
import org.junit.Before
import org.junit.Test
import org.mockito.MockitoAnnotations
import retrofit2.Retrofit
import retrofit2.converter.gson.GsonConverterFactory

class ExampleUnitTest {

    private lateinit var apiService: ApiService
    private lateinit var retrofit: Retrofit

    @Before
    fun setUp() {
        MockitoAnnotations.initMocks(this)

        retrofit = Retrofit.Builder()
            .client(OkHttpClient.Builder().apply {
                addInterceptor(HttpLoggingInterceptor().apply {
                    level = HttpLoggingInterceptor.Level.BODY
                })        // Retrofit 에서 통신 과정의 로그를 확인하기 위함. 로그의 level 을 지정
            }.build())
            .baseUrl(Const.BASE_URL)
            .addConverterFactory(GsonConverterFactory.create())
            .build()

        apiService = retrofit.create(ApiService::class.java)
    }

    @Test
    fun test_getRepositories() {
        val it = apiService.getRepositories().execute().body()?.asJsonObject?.getAsJsonArray("items")
        val type = object : TypeToken<List<GithubRepos>>() {}.type
        val result = GsonBuilder().setLenient().create().fromJson(it, type) as List<GithubRepos>
        result.forEach { println("it = $it") }

//        assertEquals(result, emptyList<GithubRepositories>())
    }

